import Gallery from "./Gallery";
function Profile() {
  return (
    <img
      src="https://i.imgur.com/MK3eW3As.jpg"
      alt="Katherine Johnson"
    />
  );
}

export default function App() {
  return (
    <>
      <h1>了不起的科学家</h1>
      <Gallery />
    </>
  );
}
